import React from 'react'
import { TextField } from '@material-ui/core'

export default function TextInput(props) {
    return (
        <TextField 
            id="outlined-basic" 
            variant="outlined" 
            label={props.label} 
            name={props.name}
            value={props.value}
            className={props.style}
            helperText={props.helperText}
            onChange={props.onChange}
      />
    )
}
